#include <gtest/gtest.h>
#include "reorder_list.cpp"

class ReorderListTest: public testing::Test{
    protected:
        Solution sol;
};
TEST_F(ReorderListTest, Small){
    int a[] = {1,2,3,4};
    VI nums(ASZ(a));
    int z[] = {1,4,2,3};
    VI ans(ASZ(z));
    ListNode *head(vector2List(nums));
    sol.reorderList(head);
    EXPECT_EQ(ans, list2Vector(head));
}
TEST_F(ReorderListTest, Small2){
    int a[] = {1,2};
    VI nums(ASZ(a));
    int z[] = {1,2};
    VI ans(ASZ(z));
    ListNode *head(vector2List(nums));
    sol.reorderList(head);
    EXPECT_EQ(ans, list2Vector(head));
}
